import React from "react";


const Item = ({prods}) => {
 prods.map((prod,index)=>{
  <h1 key={index}>prods.Nombre</h1>
 })
  return (
    <>
    <div>
        <h1 key={prods}>{prods.Nombre}</h1>
        <h1 key={prods}>{prods.Descripcion}</h1>
        <h1 key={prods}>{prods.Stock}</h1>
        <h1 key={prods}>{prods.boton}</h1>
        </div>
    </>
  );
}; 

export default Item;
